try {
    $ErrorActionPreference = "Stop"
    Write-Host "Attempting to take screenshot using Windows API..."

    # Create temp directory
    $tempPath = "C:	emp"
    if (\"(Test-Path $tempPath)) {
        New-Item -ItemType Directory -Path $tempPath -Force | Out-Null
    }

    # Generate filename with timestamp
    $timestamp = Get-Date -Format "yyyyMMdd_HHmmss"
    $filename = "$tempPath\screenshot_$timestamp.png"

    # Try using built-in screenshot capability
    $screenCapture = @"
using System;
using System.Runtime.InteropServices;
using System.Drawing;
using System.Drawing.Imaging;
using System.Windows.Forms;
public class ScreenCapture
{
    public static void CaptureScreen(string filename)
    {
        Rectangle bounds = Screen.PrimaryScreen.Bounds;
        using (Bitmap bitmap = new Bitmap(bounds.Width, bounds.Height))
        {
            using (Graphics g = Graphics.FromImage(bitmap))
            {
                g.CopyFromScreen(Point.Empty, Point.Empty, bounds.Size);
            }
            bitmap.Save(filename, ImageFormat.Png);
        }
    }
}
"@

    Add-Type -TypeDefinition $screenCapture -ReferencedAssemblies System.Drawing,System.Windows.Forms

    [ScreenCapture]::CaptureScreen($filename)

    if (Test-Path $filename) {
        Write-Host "Screenshot saved successfully: $filename"
        $fileInfo = Get-Item $filename
        Write-Host "File size: $($fileInfo.Length) bytes"
        Write-Host "Created: $($fileInfo.CreationTime)"
    } else {
        Write-Host "Screenshot file was not created"
    }
}
catch {
    Write-Host "Error taking screenshot: $($_.Exception.Message)"
    Write-Host "This might be due to:"
    Write-Host "1. No GUI session (headless environment)"
    Write-Host "2. Security restrictions"
    Write-Host "3. Missing required assemblies"
}

