Write-Host "=== Environment Check ===" -ForegroundColor Yellow
Write-Host "PowerShell Version: $($PSVersionTable.PSVersion)"
Write-Host "OS: $([System.Environment]::OSVersion)"
Write-Host "User Interactive: $([System.Environment]::UserInteractive)"

try {
    Write-Host "`n=== Display Detection ===" -ForegroundColor Yellow
    Add-Type -AssemblyName System.Windows.Forms
    $screen = [System.Windows.Forms.Screen]::PrimaryScreen
    Write-Host "Primary Screen Bounds: $($screen.Bounds)"
    Write-Host "Working Area: $($screen.WorkingArea)"
    Write-Host "Screen detected successfully"
} catch {
    Write-Host "No display detected: $($_.Exception.Message)"
}

try {
    Write-Host "`n=== Session Type Check ===" -ForegroundColor Yellow
    $sessionName = [System.Environment]::GetEnvironmentVariable("SESSIONNAME")
    Write-Host "Session Name: $sessionName"

    $logonServer = [System.Environment]::GetEnvironmentVariable("LOGONSERVER") 
    Write-Host "Logon Server: $logonServer"

    if ($env:SSH_CONNECTION) {
        Write-Host "SSH Connection detected"
    }

    # Check if running in Windows Terminal, console, or RDP
    $parent = Get-WmiObject -Class Win32_Process -Filter "ProcessId = $PID" | Select-Object -ExpandProperty ParentProcessId
    $parentProcess = Get-Process -Id $parent -ErrorAction SilentlyContinue
    Write-Host "Parent Process: $($parentProcess.ProcessName)"

} catch {
    Write-Host "Session check failed: $($_.Exception.Message)"
}

