    Write-Host "SUCCESS\! Screenshot file exists\!" -ForegroundColor Green
    Write-Host "Size: $($fileInfo.Length) bytes" -ForegroundColor Yellow
    Write-Host "Created: $($fileInfo.CreationTime)" -ForegroundColor Yellow
    Write-Host "Path: $($fileInfo.FullName)" -ForegroundColor Cyan

    # Check if it is a valid PNG file
    try {
        $bytes = Get-Content "C:	emp	arget.png" -Encoding Byte -TotalCount 8
        if ($bytes.Length -ge 4) {
            $pngSignature = [System.Text.Encoding]::ASCII.GetString($bytes[1..3])
            Write-Host "PNG header check: $pngSignature" -ForegroundColor Cyan

            if ($pngSignature -eq "PNG") {
                Write-Host "This is a valid PNG file\!" -ForegroundColor Green
            } else {
                Write-Host "File header indicates this might not be a valid PNG" -ForegroundColor Yellow
            }
        }
    } catch {
        Write-Host "Could not check PNG header: $($_.Exception.Message)" -ForegroundColor Red
    }
} else {
    Write-Host "Screenshot file was not created" -ForegroundColor Red
    Write-Host "Listing C:	emp directory:" -ForegroundColor Yellow
    Get-ChildItem "C:	emp" -Force | Format-Table Name, Length, LastWriteTime
}

